const nExtra = {
	whale : 0,
	burnable: 0,
	pausable: 0
}
function addExtra(type) {
	// Get the checkbox
	var checkBox = document.getElementById(type);
	// If the checkbox is checked, display the output text
	if (checkBox.checked == true){
		nExtra[type] = 1;
		//nExtra += 1;
		//document.getElementById(displayA).style.display = "block";
		//document.getElementById(displayF).style.display = "block";
	} else {
		nExtra[type] = 0;
		//document.getElementById(displayA).style.display = "none";
		//document.getElementById(displayF).style.display = "none";
	}
	if (nExtra.whale ===1){
		document.getElementById('maxWhale').style.display=""
	} else {document.getElementById('maxWhale').style.display="none"}
	console.log(nExtra);
	dollarAmount(nExtra);
	return nExtra;
}
