let dollars = 45; //50
function dollarAmount(nExtra){
	if (nExtra.whale + nExtra.burnable + nExtra.pausable == 0){
		dollars = 45 //50; //o equivalente en ether/wei
		document.getElementById("price-variable").innerHTML = dollars;
		document.getElementById("price-detail").innerHTML = '(Token + 0 extras)';
	} else if (nExtra.whale + nExtra.burnable + nExtra.pausable == 1){
		dollars = 80 //75; //o equivalente en ether/wei
		document.getElementById("price-variable").innerHTML = dollars;
		document.getElementById("price-detail").innerHTML = '(Token + 1 extra)';
	} else if (nExtra.whale + nExtra.burnable + nExtra.pausable == 2){
		dollars = 95 //100; //o equivalente en ether/wei
		document.getElementById("price-variable").innerHTML = dollars;
		document.getElementById("price-detail").innerHTML = '(Token + 2 extras)';
	} else if (nExtra.whale + nExtra.burnable + nExtra.pausable == 3){
		dollars = 110 //125; //o equivalente en ether/wei
		document.getElementById("price-variable").innerHTML = dollars;
		document.getElementById("price-detail").innerHTML = '(Token + 3 extras)';
	} else{
		console.log('An error occured when selecting the extras');
	}
	console.log(dollars);
	return dollars;
}

/*3.4 ...Seleccionar ABI y Bytecode final... */
var abiFinal = abiTermNoextras;
var bytecodeFinal = bytecodeTermNoExtras;

function selectAbi(){
	if (nExtra.whale === 0 & nExtra.burnable === 0 & nExtra.pausable === 0){
		abiFinal = abiTermNoextras;
		bytecodeFinal = bytecodeTermNoExtras;
		return abiFinal, bytecodeFinal

	} else if (nExtra.whale === 1 & nExtra.burnable === 0 & nExtra.pausable === 0){
		abiFinal = abiTermWhale;
		bytecodeFinal = bytecodeTermWhale;
		console.log(nExtra);
		console.log('entra');
		return abiFinal, bytecodeFinal

	} else if (nExtra.whale === 0 & nExtra.burnable === 1 & nExtra.pausable === 0){
		abiFinal = abiTermBurnable;
		bytecodeFinal = bytecodeTermBurnable;
		return abiFinal, bytecodeFinal

	} else if (nExtra.whale === 0 & nExtra.burnable === 0 & nExtra.pausable === 1){
		abiFinal = abiTermPausable;
		bytecodeFinal = bytecodeTermPausable;
		return abiFinal, bytecodeFinal

	} else if (nExtra.whale === 1 & nExtra.burnable === 1 & nExtra.pausable === 0){
		abiFinal = abiTermWB;
		bytecodeFinal = bytecodeTermWB;
		return abiFinal, bytecodeFinal

	} else if (nExtra.whale === 1 & nExtra.burnable === 0 & nExtra.pausable === 1){
		abiFinal = abiTermWP;
		bytecodeFinal = bytecodeTermWP;
		return abiFinal, bytecodeFinal

	} else if (nExtra.whale === 0 & nExtra.burnable === 1 & nExtra.pausable === 1){
		abiFinal = abiTermBP;
		bytecodeFinal = bytecodeTermWPB;
		return abiFinal, bytecodeFinal

	} else if (nExtra.whale === 0 & nExtra.burnable === 0 & nExtra.pausable === 0){
		abiFinal = abiTermWPB;
		bytecodeFinal = bytecodeTermWPB;
		return abiFinal, bytecodeFinal
	} else {
		console.log('An error occured');
	}
}
